description:
Ready for some mental flossing? At the Blissful Brain Holistic Luxury Spa, your job is to clean the minds of the spa guests - literally! Capture Nega-Tics, the nasty little creatures in our heads that make us do bad things. Your goal is to sweep them completely Out of Your Mind. But is your boss, the mysterious Belinda Blissful, up to something sinister? Play Out of Your Mind and experience a new kind of mental mania. From the creators of Diner Dash.
